---
<strong>gud-gdbmi-completions</strong> is a compiled Lisp function in `<code>gdb-mi.el</code>'.</br>
</br>
(gud-gdbmi-completions <u>CONTEXT</u> <u>COMMAND</u>)</br>
</br>
Completion table for GDB/MI commands.</br>
<u>COMMAND</u> is the prefix for which we seek completion.</br>
<u>CONTEXT</u> is the text before <u>COMMAND</u> on the line.
